import App from './App.vue';
import { createApp } from 'vue';
import { createRouter, createWebHistory } from 'vue-router';
import LobbyOne from './components/LobbyOne.vue';
import LobbyTwo from './components/LobbyTwo.vue';
import Login from "./components/Introduction/Login.vue";
import SignUp from './components/Introduction/SignUp.vue';
import MyOwnAccount from './components/Introduction/MyOwnAccount.vue';
import Help from './components/Options/Help.vue';
import Policy from './components/Options/Policy.vue';
import Schools from './components/Schools.vue';


const router = createRouter({
    history: createWebHistory(),
    routes:
    [
        {path: "/login", component: Login},
        {path: "/lobbyOne", component: LobbyOne},
        {path: "/lobbyTwo", component: LobbyTwo},
        {path: "/SignUp", component: SignUp},
        {path: "/Help", component: Help},
        {path: "/Policy", component: Policy},
        {path: "/MyOwnAccount", component: MyOwnAccount},
        {path: "/Schools", component: Schools},
    ]
});


app.use(router);

